// src/pages/Finance.js
import React from 'react';
import FinanceForm from '../components/FinanceForm';
import '../Styles.css';

const Finance = () => {
  return (
    <div className="container mx-auto p-4">
      <FinanceForm />
    </div>
  );
};

export default Finance;
